import Styles from './nos2.module.css'
function QuemSomos2(){
    return(
       <div className={Styles.fim}>
        <p>
        Para obter informações adicionais  entre em contato com nossa central de atendimento. <br/>
Estamos prontos para responder a todas as suas perguntas e ajudar a construir seu futuro financeiro.
        </p>
       </div>
    )
}
export default QuemSomos2
